import { createRouter, createWebHistory } from 'vue-router';
import About from '../views/About';
import Home from '../views/Home';
import Contact1 from '../views/Contact1';
import Tasks1 from '../views/Tasks1';
import ChangeTask from '../views/ChangeTask';
import ChangeContact from '../views/ChangeContact';

const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home,
  },
  {
    path: '/about',
    name: 'About',
    component: About,
  },
  {
    path: '/contacts',
    name: 'Contacts',
    component: Contact1,
  },
  {
    path: '/tasks/:id',
    name: 'ChangeTask',
    component: ChangeTask,
  },
  {
    path: '/contacts/update_contacts',
    name: 'ChangeContact',
    component: ChangeContact,
  },
  {
    path: '/tasks',
    name: 'Tasks',
    component: Tasks1,
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
